import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";
import "./ClubDetails.css"; // CSS dosyanızı ekleyin

const ClubDetails = () => {
  const { id } = useParams(); // URL'den clubId'yi alıyoruz
  const [club, setClub] = useState(null); // Kulüp bilgileri
  const [players, setPlayers] = useState([]); // Oyuncu bilgileri
  const [loadingPlayers, setLoadingPlayers] = useState(true); // Oyuncu yükleme durumu

  useEffect(() => {
    const fetchClubDetails = async () => {
      try {
        // Kulüp detaylarını çek
        const clubResponse = await axios.get(
          `http://localhost:8080/api/v1/clubs/{id}`
        );
        setClub(clubResponse.data);

        // Oyuncu bilgilerini çek
        const playersResponse = await axios.get(
          `http://localhost:8080/api/v1/clubs/{id}/players`
        );
        setPlayers(playersResponse.data);
      } catch (error) {
        console.error("Error fetching club details:", error);
      } finally {
        setLoadingPlayers(false); // Oyuncu yüklenme durumunu kapat
      }
    };

    fetchClubDetails();
  }, [id]);

  if (!club) {
    // Kulüp bilgisi yoksa "loading" göster
    return <div>Loading club details...</div>;
  }

  return (
    <div className="club-details">
      {/* Kulüp Bilgileri */}
      <div className="club-info">
        <h2>{club.clubName}</h2>
        <p><strong>League:</strong> {club.leagueName}</p>
        <p><strong>Reputation:</strong> {club.reputation}</p>
        <p><strong>Manager:</strong> {club.managerName}</p>
      </div>

      {/* Oyuncu Listesi */}
      <div className="club-players">
        <h3>Players</h3>
        {loadingPlayers ? (
          <p>Loading players...</p>
        ) : players.length > 0 ? (
          <table className="players-table">
            <thead>
              <tr>
                <th>Name</th>
                <th>Position</th>
                <th>Age</th>
              </tr>
            </thead>
            <tbody>
              {players.map((player) => (
                <tr key={player.id}>
                  <td>{player.name}</td>
                  <td>{player.position}</td>
                  <td>{player.age}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>No players available for this club.</p>
        )}
      </div>
    </div>
  );
};

export default ClubDetails;
